import './../styles/css/main.css';

function Aboutus() {
    return(
        <section>
            <div className="container">
                <p className="text_sobrenosotros"> Somos una agencia especializada en marketing, publicidad y desarrollo web.
                Llevamos más de 25 años ayudando a nuestros clientes a desarrollar su marca personal. Esta trayectora profesional nos permite anticiparnos a las últimas tendencias del mercado.
                Ogilvy está compuesto por profesionales de amplia experiencia en todos los ámbitos.</p>
                <img className="img_sobrenosotros" src='./images/ogilvy-sobrenosotros' alt='Imagen-ogilvy'></img>
            </div>
        </section>
    )
}  

export default Aboutus;
